export default class AnamsTestPen extends React.Component { 

  handleSubmit = (event) => { 
    // console.log(event.target.previousSibling.value)
    fetch("localhost:8000", {
      method: "POST",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({
        text: event.target.previousSibling.value
      })
    })
    .then(resp => resp.json())
    .then(something => {
      debugger
    })
  }

  render(){
    return (
      <div>
        <input type="text" /> 
        <input type="submit" onClick={this.handleSubmit}/>
      </div>
    )
  }

}
